import React from 'react';
import Nav from './Nav.js';
import Router from './Router.js';
import "./index.css";
import Footer from './Footer.js';

const App = (props) => {
  return (
    <div>
      <Nav/>
      <Router/>
      <Footer/>
    </div>
  );
}

export default App;
